import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux'; // Importa el Provider
import store from './path-to-your-redux-store'; // Importa tu store de Redux
import App from './App';

const rootElement = document.getElementById('root');
const root = ReactDOM.createRoot(rootElement);

root.render(
  <Provider store={store}> {/* Envuelve tu componente con Provider y pasa el store */}
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Provider>
);

